import React from 'react';
import classes from './registration.css';

const Registration = () => (
    <div>
        <form>
            <div className={classes.container}>
                <h1>Register Doctor</h1>
                <p>Please fill in this form to register</p>
            </div>
        </form>
    </div>

);

export default Registration;
